import React,{useEffect} from "react";
import axios from "axios"
import{
    View,
    Text
} from 'react-native';
export default function Fetch() {
   
    useEffect(() => {
      axios.get('https://jsonplaceholder.typicode.com/todos')
      .then(response => response.data)
      .then(json => console.log(json))
      },[]);
    
    return (
      <View>
          <Text></Text>
      </View>
    );
  }
